      flex: 1,
      backgroundColor: 'white',
      alignItems: 'center',
      justifyContent: 'center',
    },
    header:{
      flexDirection:'row',
      backgroundColor:'red',
      width:'100%',
      height:'8%',
    },
    textoDePefil:{
      backgroundColor:'white',
      width:'55%',
      alignItems:'flex-end',
      justifyContent:'flex-end',
    },
    botNav:{
      backgroundColor:'red',
      width:'45%',
      alignItems:'flex-end',
    },
    body:{
      height:'77%',
      width:'100%',
      backgroundColor:'green',
    },
    parteCima:{
      height:'30%',
      width:'100%',
      flexDirection:'row',
      backgroundColor:'pink',
    },
    voltaImg:{
      height:'100%',
      width:'30%',
      backgroundColor:'yellom'
    },
    logUm:{
      height: 150,
      width: 150,
      borderColor: 'red',
      borderWidth: 5,
      borderRadius: 100,
    },
    footer:{
      backgroundColor:'red',
      width:'100%',
      height:'15%',
    },
    textoH1:{
      fontSize:20,
    },
  });
